import javax.servlet.*;
import javax.servlet.http.*;
import javax.servlet.annotation.*;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

@WebServlet(name = "Product", value = "/product")
public class ProductManagement extends HttpServlet {
    @Override
    protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        List<Product> products = new ArrayList<>();
        products.add(new Product( "Nguyễn Thuỳ Dung", "20/09/1995", "Hà Nội", "data:image/jpeg;base64,"));
        products.add(new Product( "Nguyễn Minh Trang", "11/1/1999", "Hồ Chí Minh", "data:image/jpeg;base64,"));
        products.add(new Product("Trần Thị Loan", "12/08/1999", "Đà Nẵng", "data:image/jpeg;base64,"));
        products.add(new Product("Nguyễn My Nhật", "21/03/2001", "Hà Nội", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRkdBs9esa1KjKiA86IuCnoqnv9aaDkzgZHDA&usqp=CAU"));
        request.setAttribute("product", products);
        RequestDispatcher dispatcher = getServletContext().getRequestDispatcher("/index.jsp");
        dispatcher.forward(request, response);

    }

    @Override
    protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {

    }
}
